import React, { Component } from 'react'
import axios from 'axios';

export default class ListMembers extends Component {
    constructor(props) {
        super(props)
    
        this.state = {
             members :[]
        }
    }

    componentDidMount() {
        axios.get(`http://localhost:8092/familytree/member`)
          .then(response => {
            console.log(response);
            this.setState({members:response})
          }).catch(error =>{
              console.log(error);
          } )
      }
    
    
    render() {
        const {members} = this.state
        return (
            <div>
                <h2>List of Members</h2>
                members.length ?
                members.map(member => <div key={member.id}>{member.name}</div>)
            </div>
        )
    }
}
